import { useNavigate } from "react-router-dom";
import "./Main.css"

function PatientPrescList() {
    const presc = [
        { name: "방문 병원 1", date: "2023-04-05", path: "/presc1"},
        { name: "방문 병원 2", date: "2023-04-05", path: "/presc2"},
        { name: "방문 병원 3", date: "2023-04-08", path: "/presc3"}
    ];

    const navigate = useNavigate();
    const viewPresc = (props) => {
        navigate(props);
    };

    return (
        <div className="main">
            <h1 id="header">Prescription System</h1>
            <div className='list'>
                {presc.map((pre, index) => {
                    return (
                        <button variant="primary" size="lg" onClick={viewPresc(pre.path)}>
                            {pre.name} / {pre.date}
                        </button>
                    ); 
                })}
            </div>
        </div>
    );
}

export default PatientPrescList;
